package org.apache.commons.dbutils;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.AfterEach;
import static org.junit.jupiter.api.Assertions.assertTrue;
import static org.mockito.Mockito.mock;
import static org.mockito.Mockito.doThrow;

import java.io.ByteArrayOutputStream;
import java.io.PrintStream;
import java.sql.Connection;
import java.sql.SQLException;

public class DataAccessErrorHandlingTest {

    private final ByteArrayOutputStream errContent = new ByteArrayOutputStream();
    private final PrintStream originalErr = System.err;

    @BeforeEach
    public void setUpStreams() {
        System.setErr(new PrintStream(errContent));
    }

    @AfterEach
    public void restoreStreams() {
        System.setErr(originalErr);
    }

    @Test
    public void testDatabaseErrorIsLoggedToStdErr() throws Exception {
        final Connection mockConnection = mock(Connection.class);
        doThrow(new SQLException("Simulated database error")).when(mockConnection).close();

        // This test assumes that the DbUtils class has a built-in diagnostic capability
        // to log SQLExceptions to the standard error stream when a quiet close is performed.
        DbUtils.closeQuietly(mockConnection);

        // Verify that the error was indeed printed to System.err
        final String errOutput = errContent.toString();
        assertTrue(errOutput.contains("Simulated database error"),
                "Expected the database error to be logged to the standard error stream, but it was not.");
    }
}

